import React from 'react';

const BookList = props => {
    const books = props.books.map((book) => {
        return (
            <div key={book.id} >
                <img alt={book.volumeInfo.title} src={book.volumeInfo.imageLinks.thumbnail} />
            </div>
        )
    });
    return (
        <div >
            <div className="card">{books}</div>
        </div>
    )
};

export default BookList;
